def manual_unitvec(vec):
    norm = np.linalg.norm(vec)
    if norm == 0:
        return vec
    return vec / norm

def sample_dict(d, n=10, use_random=True):
    if use_random:
        items = random.sample(d.items(), min(n, len(d)))
    else:
        items = list(d.items())[:n]
    return items

def merge_counts(dict1, dict2):
    for key, value in dict2.items():
        dict1[key] = dict1.get(key, 0) + value
    return dict1

def any2utf8(text, errors='strict', encoding='utf8'):
    if isinstance(text, str):
        return text.encode('utf-8')
    elif isinstance(text, bytes):
        return text.decode(encoding, errors).encode('utf-8')
    else:
        raise TypeError("Input text must be a string or bytes")

