@contextmanager
def open_file(input):
    if isinstance(input, str):
        with open(input, 'r') as file:
            yield file
    elif isinstance(input, collections.abc.Iterable):
        yield input
    else:
        raise ValueError("Input must be a string representing a filename or a file-like object")

